script: |
  super -f text -I q453.spq | sort > q453.out

inputs:
  - name: q453.spq
    data: |
      SELECT DISTINCT - ( - + COUNT ( * ) ) AS col0 FROM tab0 (FORMAT parquet) cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q453.out
    data: |
      9
